import {App} from '../App'

export default function Statistics ({title, stats}) {
    return (
        <section class="statistics">
          {title && <title>{title}</title>}
          <List>
            {stats.map()}
          </List>
 
  <ul class="stat-list">
    <li class="item">
      <span class="label">{stats.label}</span>
      <span class="percentage">{stats.percentage} </span>
    </li>
    
  </ul>
</section>
    )
}
